import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';
import callRootreducer from './Reducers/index';
import { createStore,applyMiddleware } from 'redux';
const logger = ({dispatch,getState})=>(next)=>(action)=>{
  console.log('ACTION TYPE :',action.type);
  next(action);
}

const newmdware = ({dispatch,getState})=>(next)=>(action)=>{
  if(typeof action ==='function')action(this.props.store)
}
const store = createStore(callRootreducer,applyMiddleware(logger,newmdware));
ReactDOM.render(
  <React.StrictMode>
    <App store = {store} />
  </React.StrictMode>,
  document.getElementById('root')
);
